#include <iostream>\n#include <random>\n\nint main() {\n    // Initialize random number generator using a fixed seed\n    std::mt19937 gen(42); // Using Mersenne Twister with seed 42\n\n    // Define a distribution range\n    std::uniform_int_distribution<> distr(0, 255);\n\n    // Generate and print five random numbers\n    for (int i = 0; i < 5; ++i) {\n        std::cout << distr(gen) << " ";\n    }\n    std::cout << std::endl;\n\n    return 0;\n}